db.patients.aggregate([ 
    { $match: {"OBSERVATIONS.DESCRIPTION": "Hematocrit [Volume Fraction] of Blood by Automated count"} }, 
    { $project: { _id: 0, first: "$FIRST", last: "$LAST" } } 
])

db.patients.aggregate([ 
    { $match: {"OBSERVATIONS.DESCRIPTION": "Influenza virus B RNA [Presence] in Respiratory specimen by NAA with probe detection"} }, 
    { $unwind: "$OBSERVATIONS" }, 
    { $match: {"OBSERVATIONS.DESCRIPTION": "Influenza virus B RNA [Presence] in Respiratory specimen by NAA with probe detection"} }, 
    { $project: { _id: 0, observation_date: "$OBSERVATIONS.DATE" } } 
])

