db.patients.aggregate([ 
    { 
        $lookup: { 
            from: "payers", 
            localField: "PAYER_TRANSITIONS.PAYER_REF", 
            foreignField: "PAYER_ID", 
            as: "payer_details" 
        } 
    }, 
    { 
        $unwind: "$PAYER_TRANSITIONS" 
    }, 
    { 
        $unwind: "$payer_details" 
    }, 
    { 
        $match: { "payer_details.NAME": "Humana" } 
    }, 
    { 
        $project: { 
            _id: 0, 
            first: "$FIRST", 
            last: "$LAST" 
        } 
    }, 
    { 
        $group: { 
            _id: { 
                first: "$first", 
                last: "$last" 
            } 
        } 
    }, 
    { 
        $project: { 
            _id: 0, 
            first: "$_id.first", 
            last: "$_id.last" 
        } 
    } 
])

